import { Component } from "react";
export default class SingleImage extends Component {
  imageDetals = (detals) => {
    return (
      <div className="cityImage">
        <img className="cityImage" src={this.props.imgSRC} />
        <p>City name: {detals.FullName}</p>
        <p>Continent :{detals.continent}</p>
        <p>
          Location :<p>{detals.boundingBox.east}</p>
          <p>{detals.boundingBox.north}</p>
          <p>{detals.boundingBox.south}</p>
          <p>{detals.boundingBox.west}</p>
        </p>
      </div>
    );
  };
  render() {
    return <div>{this.imageDetals(this.props.detals)}</div>;
  }
}
